import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
  },
  menuLogo: {
    height: "30px",
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
}));

export default useStyles;
